"  scale_fill_gradient(low = \"light blue\", high = \"dark blue\") +\n","  theme(axis.text.x = element_text(angle = 90, vjust = 0.5, hjust = 1)) + \n","  labs(title = 'Amount of top view channel got paid',\n","       x = 'USD (per 1000 dollars)',\n","       y = 'Category')"]},{"cell_type":"markdown","id":"8005e697","metadata":{"papermill":{"duration":0.015835,"end_time":"2022-10-15T17:50:12.268359","exception":false,"start_time":"2022-10-15T17:50:12.252524","status":"completed"},"tags":[]},"source":["MrBeast earns lots of money!\n","\n","### 3-2. Channels with excluded categories\n","\n","Because channels with high views are music, movies, sports, TV shows, we want to exclude those to see what types of channels give higher views."]},{"cell_type":"code","execution_count":15,"id":"9e3b4dc3","metadata":{"execution":{"iopub.execute_input":"2022-10-15T17:50:12.304412Z","iopub.status.busy":"2022-10-15T17:50:12.303109Z","iopub.status.idle":"2022-10-15T17:50:13.841266Z","shell.execute_reply":"2022-10-15T17:50:13.839291Z"},"papermill":{"duration":1.558534,"end_time":"2022-10-15T17:50:13.843436","exception":false,"start_time":"2022-10-15T17:50:12.284902","status":"completed"},"tags":[]},"outputs":[],"source":["## Exclude music, films, sports, etc\n","# list of commercials to be excluded\n","comm_ch_list <- c(\"HYBE LABELS\", \"starshipTV\", \"Stone Music Entertainment\", \n","                  \"NPR Music\", \"Navrattan Music\", \"Strange Music Inc\",\n","                  \"Zee Music Company\", \"Desi Music Factory\",\n","                  \"Paramount Pictures\", \"Warner Bros. Pictures\", \"Sony Pictures Entertainment\",\n","                  \"Universal Pictures\", \"Magnolia Pictures & Magnet Releasing\",\n","                  \"Orion Pictures\", \"Marvel Entertainment\", \"JYP Entertainment\", \"Big Hit Labels\",\n","                  \"Apple\", \"amazon\",  \"T-Mobile\", \"Samsung Mobile USA\", \"Google\")\n","\n","comm_title_list <- c(\"Music Video\", \"Official Video\